/**
 * get the current working dir name of file and file name.
 * @name fileInfo
 * @param relativePath
 * @returns {object}
 * @example
 * ```js
 *  currentDirName() // => 'bit'
 * ```
 */
export default function calculateFileInfo(relativePath: string): {
    PARENT: string;
    FILE_NAME: string;
};
